window.bookSummaryJSON = "<p>\"Wa-ter-locked' <i>adjective</i> Definition: enclosed entirely, or almost entirely, by water Example: What happens when the water vampire you’ve promised yourself to actually wants you to go through with the wedding? For Gemma Melcombe, her engagement to Terrance Ramsay was a political maneuver. For Terry, it’s something entirely more. Rough waters may be ahead for these two headstrong lovers, but until they come to an agreement, Gemma will be waterlocked. <i>Waterlocked</i> is a stand-alone novella in the Elemental World series.</p>"; 
